select
	cell_metadata.cell_id,
	anode,
	cathode,
	source,
	ah,
	form_factor,
	tester,
	temperature,
	thickness,
	v_init,
	indentor,
	nail_speed
from 
	cell_metadata inner join abuse_metadata on cell_metadata.cell_id = abuse_metadata.cell_id 
where
	abuse_metadata.cell_id IN ({{cell_id}}) and
	cathode IN ({{cathode}}) and
    anode IN ({{anode}}) and
    ah IN ({{ah}}) and
    temperature IN ({{temperature}}) and 
    indentor IN ({{indentor}}) and
    nail_speed IN ({{nail_speed}}) and
    thickness IN ({{thickness}}) and 
    v_init IN ({{v_init}}) and
    source IN ({{source}}) and  
    form_factor IN ({{form_factor}})   
order by 
	abuse_metadata.cell_id